  false,\n\t\"url\": null,\n\t\"notes\": \"This data set is a part of Ecotrust's project
  entitled: Establishing a Baseline and Assessing Spatial and Socioeconomic Change
  in the California Central Coast Commercial and CPFV Fisheries. This project is a
  component of the California Central Coast Marine Protected Area Baseline Monitoring
  Project that is designed to characterize the ecological and socioeconomic conditions
  and changes within the Central Coast Region since MPA implementation. The Central
  Coast study region extends from the north at Pigeon Point to the south at Point
  Conception. This data set consists of data collected to inform the California Marine
  Life Protection Act (MLPA) planning process in the summer of 2005 from fisheries
  mapping interviews with commercial fishermen who had Dungeness crab--trap landings
  in the California Central Coast between 2003 and 2004. Results from the interviews
  were then combined through an aggregation process where the value each fisherman
  gives to their Dungeness crab fishing grounds are weighted by their average annual
  landings for Dungeness crab from 2000 to 2004. This data set represents the average
  spatial extent and relative value of Dungeness crab commercial fishing grounds for
  the Central Coast Region in the years 2000 to 2004.\",\n\t\"license_title\": null,\n\t\"extras\":
